import React, { Fragment } from 'react';
import { Link } from 'react-router-dom';
import Navigation from './Navigation'

const Billeterie = () => {
    return(
        <Fragment>
            <Navigation />
        <Link to ="/">
            <div className="billeterie">
                <button className="billeterie_btn">
                    Billeterie
                </button>
            </div>
        </Link>
        </Fragment>

    )
}

export default Billeterie;
